import { Map, Marker } from "2gis-maps-react";

export const TwoGis = () => {
    return (
        <Map
            style={{width: "500px", height: "500px"}}
            center={[54.98, 82.89]}
            zoom={13}
        >
            <Marker
                pos={[54.98, 82.89]}
                label={'I\'m label.'}
            />

            <Marker
                pos={[54.98, 82.895]}
                staticLabel={'I\'m static label.'}
            />
        </Map>
    )
}

export default TwoGis;
